        for (int i = 0; i < music_string.length(); i++) {
            if (music_string.charAt(i) == 'o') {
                if (i < music_string.length() - 1 && music_string.charAt(i + 1) == '|') {
                    notes.add(2l);
                    i++;
                } else {
                    notes.add(4l);
                }
            } else if (music_string.charAt(i) == '.') {
                notes.add(1l);
            }
        }
        return notes;

