    public static ArrayList<String> numericalLetterGrade(ArrayList<Float> grades) {
        ArrayList<String> letterGrades = new ArrayList<String>();
        for (int i = 0; i < grades.size(); i++) {
            if (grades.get(i) >= 4.0f) {
                letterGrades.add("A+");
            } else if (grades.get(i) >= 3.7f) {
                letterGrades.add("A");
            } else if (grades.get(i) >= 3.3f) {
                letterGrades.add("A-");
            } else if (grades.get(i) >= 3.0f) {
                letterGrades.add("B+");
            } else if (grades.get(i) >= 2.7f) {
                letterGrades.add("B");
            } else if (grades.get(i) >= 2.3f) {
                letterGrades.add("B-");
            } else if (grades.get(i) >= 2.0f) {
                letterGrades.add("C+");
            } else if (grades.get(i) >= 1.7f) {
                letterGrades.add("C");
            } else if (grades.get(i) >= 1.3f) {
                letterGrades.add("C-");
            } else if (grades.get(i) >= 1.0f) {
                letterGrades.add("D+");
            } else if (grades.get(i) >= 0.7f) {
                letterGrades.add("D");
            } else if (grades.get(i) >= 0.0f) {
                letterGrades.add("D-");
            } else {
                letterGrades.add("E");
            }
        }
        return letterGrades;

